import React from "react"
import DeckView from "./DeckView.js"
import DeckDeleteHandler from "./DeckDeleteHandler.js"

function DeckList ({ deckList }) {
    
    const mappedList = deckList.map((deck, index) => <DeckView deck={deck} />)
    return mappedList;
}


export default DeckList
